import React from 'react';
import './stylesFiles/createAccount.css';

const CreateAccount = () => {
    return (
        <div style={{backgroundImage:"linear-gradient(to bottom right,black,darkblue)",paddingTop:"5%"}}>
            <h1 style={{fontSize:"4vw"}}>Create Account</h1>
            <form style={{marginTop:"5%"}} action="#">
                <div className="col-3 input-effect">
                    <input className="effect-17" type="text" placeholder="" />
                    <label>First Name</label>
                    <span className="focus-border"></span>
                </div>
            </form>
        </div>
    );
}

export default CreateAccount;
